const DATA = JSON.parse(CATALOG);

function normalize(s) { return (s || '').toString().toLowerCase().replace(/[^a-z0-9\-\s°\/\.]/g, ' ').replace(/\s+/g, ' ').trim(); }
function ed(a,b) {
  a = a || ''; b = b || '';
  const m = a.length, n = b.length;
  if (m === 0) return n;
  if (n === 0) return m;
  const dp = new Array(n+1);
  for (let j=0;j<=n;j++) dp[j]=j;
  for (let i=1;i<=m;i++) {
    let prev = dp[0]; dp[0]=i;
    for (let j=1;j<=n;j++) {
      const tmp = dp[j];
      dp[j] = Math.min(
        dp[j] + 1,
        dp[j-1] + 1,
        prev + (a[i-1]===b[j-1]?0:1)
      );
      prev = tmp;
    }
  }
  return dp[n];
}
function scoreRow(qTokens, raw, pn) {
  const text = normalize((pn || '') + ' ' + (raw || ''));
  if (!qTokens.length) return 0;
  let tokenScore = 0;
  let strictMatches = 0;
  for (const t of qTokens) {
    if (text.includes(t)) { tokenScore += 2; strictMatches++; }
    else {
      const words = text.split(' ');
      let best = 999;
      for (const w of words) {
        if (!w) continue;
        const d = ed(t, w);
        if (d < best) best = d;
        if (best === 0) break;
      }
      const approx = Math.max(0, 2 - best * 0.5);
      tokenScore += approx;
    }
  }
  const pnNorm = normalize(pn || '');
  const qJoined = qTokens.join(' ');
  if ((qTokens[0] || '') && pnNorm.startsWith(qTokens[0])) tokenScore += 1.5;
  if (normalize(raw || '').includes(qJoined)) tokenScore += 1.0;
  return tokenScore + strictMatches * 0.25;
}

function search(q, limit=200) {
  const nq = normalize(q);
  const tokens = nq.split(' ').filter(Boolean);
  if (tokens.length === 0) return [];
  const scored = [];
  for (const row of DATA) {
    const s = scoreRow(tokens, row.desc || '', row.pn || '');
    if (s > 0) scored.push([s, row]);
  }
  scored.sort((a,b)=>b[0]-a[0]);
  return scored.slice(0, limit);
}

function render(results, q) {
  const out = document.getElementById('results');
  const stats = document.getElementById('stats');
  out.innerHTML = '';
  stats.textContent = results.length ? `Top ${results.length} results for "${q}"` : (q ? 'No results.' : '');
  for (const [s, row] of results) {
    const div = document.createElement('div');
    div.className = 'row';
    const safeDesc = (row.desc || '').replace(/</g,'&lt;');
    div.innerHTML = `
      <div><strong>${row.pn || '(no PN)'}</strong> <span class="score">score ${s.toFixed(2)}</span></div>
      <div class="meta">${safeDesc}</div>
    `;
    out.appendChild(div);
  }
}

const q = document.getElementById('q');
q.addEventListener('input', () => {
  const results = search(q.value, 200);
  render(results, q.value);
});
setTimeout(() => { q.value = ''; q.dispatchEvent(new Event('input')); }, 0);

document.getElementById('exportCsv').addEventListener('click', () => {
  const results = search(q.value, 1000).map(([s,r])=>({score:s.toFixed(3), pn:r.pn, desc:r.desc}));
  const header = 'score,pn,desc\n';
  const body = results.map(r => `${r.score},"${(r.pn||'').replace(/"/g,'""')}","${(r.desc||'').replace(/"/g,'""')}"`).join('\n');
  const blob = new Blob([header+body], {type:'text/csv;charset=utf-8;'});
  const url = URL.createObjectURL(blob);
  const a = document.createElement('a');
  a.href = url; a.download = 'search_results.csv';
  a.click();
  URL.revokeObjectURL(url);
});
